import { useParams, useHistory, Link } from "react-router-dom";
import "./adduser.css";
const Adduser = () => {
  return (
    <div style={{ marginTop: "100px" }}>
      <form
        style={{
          margin: "auto",
          padding: "15px",
          maxWidth: "400px",
          alignContent: "center",
        }}
        onSubmit={handleSubmit}
      ></form>
    </div>
  );
};

export default Adduser;
